   "source": [
    "type_df <- df_feature %>% \n",
    "  group_by(checklist) %>% \n",
    "  tally(sort = TRUE)\n",
    "\n",
    "ggplot(data = type_df, aes(x = \"\", y = n, fill = checklist)) +\n",
    "  geom_col() +\n",
    "  geom_text(aes(label = round(n/sum(n)*100)),\n",
    "            position = position_stack(vjust = 0.5)) +\n",
    "  coord_polar(theta = \"y\") +\n",
    "  theme_minimal() +\n",
    "  labs(title = \"Hong Kong Biodiversity\", fill = \"Type\")"
   ]
